import '../Portfolio/components/Portfolio.css'

function Portfolio() {
  return (
    <div className="portfolioImage">
      <h1 className="portfolioText">SMART CITIES<br/>OPEN DATA</h1>
      <a href="" className="portfolioLink">Read More</a>
    </div>
  )
}

export default Portfolio
